import React, { Component } from "react";
import GooglePlacesAutocomplete from "react-google-places-autocomplete";



class Person extends Component {
  render() {
    
    

    return (
      <div>
        <h4><span className="badge badge-info">Person #{this.props.value}</span></h4>



        <form>
          
          <GooglePlacesAutocomplete
            placeholder="  Address"
            width
            style={{width:"500px"}}
            apiKey={"AIzaSyAF6LzDWnCO0yQ3_xVfXMYicN6MqUFl4q0"}
            onSetAddress={this.props.onSetAddress}
            onSelect={({ description }) =>
              this.props.onSetAddress(description, this.props.value)
            }
            renderSuggestions={(active, suggestions, onSelectSuggestion) => (
              <div className="list-group">
                {suggestions.map((suggestion,idx) => (
                  <button
                    style={{width:"300px"}}
                    type="button"
                    key={idx}
                    className="list-group-item list-group-item-action"
                    onClick={(event) => onSelectSuggestion(suggestion, event)}
                  >
                    {suggestion.description}
                  </button>
                ))}
              </div>
            )}
          ><div><input></input></div></GooglePlacesAutocomplete>
          <input className="form-control" style={{width:"182px"}}type="text" placeholder="Email" onChange={(e) => this.props.onSetEmail(e.target.value,this.props.value)}></input>
        </form>
      </div>
    );
  }
}

export default Person;
